                {/* container1 */}
                <div className="profilepage-container-left">
                    container 1
                </div>
                {/* container2 */}
                <div className="profilepage-container-right">
                    container 2
                </div>
            </div>
            {/* FOOTER */}
            <div className="profile-page-footer">
                footer 
